class PracticeTwo extends Component {
    state = { 
        message:'Hello'
     }
     clickHandler() {
         this.setState({
             message:'Bye'
         })
     }
    render() { 
        return ( 
            <div>
                <div>{this.state.message}</div>
                <button onClick={clickHandler()}>Click Me</button>
            </div>
         );
    }
}

export default PracticeTwo;
